import React from 'react';

class FoodNews extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        let {title,urlToImage,description}=this.props.data;
        return(
        <div className="section__item">
          <h2>Food News</h2>
          <h3>{title}</h3>
          <img 
            src={urlToImage} alt='' height={100} width={200}
            />
          <p>{description}</p>
        </div>
        )
    }
}

export default FoodNews;
